import { MY_ORDER } from '../Actions/types';

const initialState = [
  {
    size: 7,
    id: 776789,
  },
  {
    size: 11,
    id: 776769,
  },
];

export const userOrder = (state = initialState, { type, payload }) => {
  switch (type) {
    case MY_ORDER:
      return { payload };

    default:
      return state;
  }
};
